(111, '', 0, 'Angel', 'marckleef@planet.nl', 'udEmHFCAuSjzTYa', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 9, 9, 'is factually corcert. In the manufacture of goods which do not require skilled workers, China has a major advantage because assembly line pay is far lower than it is in the US. However, US manufacturing as a whole is still near an all-time high because many stateside plants produce goods that require more skilled workers. In 2008, the value added of US manufacturing stood at $1.83 trillion, the highest in the world. The trend to which Mr. Trump is referring is a shift in US manufacturing towards more skilled labor and away from rote assembly line manufacturing. While many people appear on TV and argue that the US manufacturing sector is in decline, they are only referring to one component of the sector. By and large, the quality of US-produced goods is far higher than the quality of goods produced in China.'),
