(129, '', 0, 'Juliana', 'info@tecnoquadrireggio.it', 'hVsUgZNf', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 9, 5, 'Hidden but very real factors have to be decosverid and somehow factored.Example: value of the neighbors and other external factors.  By value factoring, I mean:  barking dog all day every day = minus 15K.  Lawnmower/Leafblower guy at 7am every weekend = minus 5K.  Neighbor who seamlessly has your back, uses mature discretion, notices any aberrant activity = +30K.  Dead quiet after 9pm = +35K. Same thing for condos.  Multiple toddlers on a late swing shift schedule = minus 35K.  Possible neighbor drug use and cops occasionally showing up = minus 30K (they tend to pass out quicker than toddlers on sugar at midnight, so slightly less costly to me).  Litter and shopping carts =  minus 5K. Multiple thefts = minus 50K.  No shared walls, quiet with polite neighbors = + 40K.  These are examples of  costs'' (pyschic, emotional, satisfaction) and from now on, I am going to pencil them into rent equivalency. They are not transactionable in monies per se, but they are worth money and therefor can be quantified. Idea:  a web site equivalent to SeattleBubble, but examing the curiousities, over inflated value, conditions of rental SFH and condos is overdue!  A small army rent and they need an outlet to brag or vent, to the education of all.    Rate this comment:  0  0'),
