(366, '', 0, 'Nataliane', 'iaau3ub9t@gmail.com', 'DMYgUU3VFBHd', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 58, 1, 3, 'Thanks, windbell for coenmmting and sharing such a useful bit of information. I followed the link and it''s really a very nice tutorial.Thanks again for sharing that with us.Thanks, Pat for adding that site to the list.'),
(367, '', 0, 'Piotr', 's74q5y08zy2@yahoo.com', 'oamAEjtEmg4p', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 3, 1, 'If you do there are 2 major things to coseidnr. . . 1 most important do not buy sight unseen.  Even if you deal with a well known, 1st class realty company they are are mainly interested in making a sale and if you don''t see property in person (not the brochures, pics, etc.  they may send) but stand there looking at it.  If you can spend big $$$ on investment, invest for a ticket to see it 1st.  Make no deals or give any money without full knowledge.Go there and deal 1st hand after you do some net homework.2 you need to know the property laws, taxation, etc.  of the country.  One of the most important ?''s is Why is it for sale?Good luck'),
(368, '', 0, 'Gabriel', 'c0juz45zy@outlook.com', 'QHoI3PnG', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 9, 8, 'Apartments Parque Santiago 1,2,3,4 in Playa De Santiagowhich is in the south of the island right on the beach in Playa de las AmericasApartments 3 and 4 are just a touch bteter then 1 and 2 but all lovely.  I can really recommend these.   Please have a look at web site.Have a lovely time.'),
(369, '', 0, 'Kalpana', 'zwuwxs1qg37@yahoo.com', 'jx1cz9WE1w9', 0, 2, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 13, 10, 'If you do there are 2 major things to coinsder. . . 1 most important do not buy sight unseen.  Even if you deal with a well known, 1st class realty company they are are mainly interested in making a sale and if you don''t see property in person (not the brochures, pics, etc.  they may send) but stand there looking at it.  If you can spend big $$$ on investment, invest for a ticket to see it 1st.  Make no deals or give any money without full knowledge.Go there and deal 1st hand after you do some net homework.2 you need to know the property laws, taxation, etc.  of the country.  One of the most important ?''s is Why is it for sale?Good luck'),
(370, '', 0, 'Nicholas', 't0l0vwai8v@hotmail.com', '2yZJutdYXzHq', 0, 6, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 15, 2, 'Yes Linda., it is. IBI is like council tax in the UK, so is a tax on your preropty and is collected by the council responsible for where you own. Whereas non residents income tax is a tax on you personally, and is collected by the tax office ( Hacienda)'),
(371, '', 0, 'Denise', 'h6j1fs6ilv@hotmail.com', 'XcjNgmY66', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 8, 2, 'It is Camp Journeys End but they are full, there is a Suburban Lodge and Best Western in Gautier. There is also a regency hotel in Ocean Springs as well as antheor Best Western.'),
