INSERT INTO `tbl_faq` (`faq_id`, `faq_que`, `faq_ans`, `faq_status`) VALUES
(1, '1.Can I purchase less than a 4''x 8'' sheet?', '<p>\r\n	Because we sell primarily wholesale, we only sell in full sheet quantities, 4&rsquo;x 8&rsquo; and larger.</p>\r\n', 'A'),
(2, '2.How do I figure the total price of the veneer?', '<p>\r\n	All of our veneer is sold per square foot. Therefore, when buying a 4&rsquo;x 8&rsquo; sheet, it&rsquo;s the square foot price times 32 sq.ft. 4&rsquo;x 10&rsquo; would be square foot price times 40 sq.ft. and so on.</p>\r\n', 'A'),
(3, '3.Can I stain veneer just like real wood?', '<p>\r\n	Yes, you can because it is real wood! Once the veneer is applied, you can sand it and stain it just like you would any solid wood.</p>\r\n', 'A'),
(4, '4.What type of glue should I use to hold the veneer in place?', '<p>\r\n	The best glues to use are urea formaldehyde, white or yellow PVA (wood glue) or epoxy. With these glues, however, you must keep consistent pressure on the surface during the glue&rsquo;s cure time by means of clamping or pressing in a hydraulic or vacuum press. If these pressing methods aren&rsquo;t available to you, an instant bond can be achieved with contact cement and the appropriate veneer.</p>\r\n', 'A'),
(5, '5.Do I need special tools to cut the veneer?', '<p>\r\n	Actually, flexible veneer cuts easily with a sharp razor knife, utility knife or scissors.Actually, flexible veneer cuts easily with a sharp razor knife, utility knife or scissors.</p>\r\n', 'A');
