INSERT INTO `tbl_news` (`ns_id`, `ns_title`, `ns_description`, `ns_image`, `ns_date`, `ns_status`) VALUES
(1, 'Opening applications in Run ', '<p>\r\n	Although applications can be opened in a variety of ways, the Run line often provides the quickest route. Desktop shortcut icons are also a quick route but you have to know how to create a shortcut for all the applications and you may end up with dozens of icons.</p>\r\n<p>\r\n	The best candidates for the Run line are applications that are in the &quot;path&quot; environment. (Go to <a href="http://vlaurie.com/computers2/Articles/environment.htm">this page</a> for more discussion of the path.) The path environment is a set of folders whose names do not</p>\r\n', '1317302701cat1.jpg', '2011-09-28', 'A'),
(2, 'Opening folders in Run ', '<p>\r\n	Not only files but also folders can be opened in the Run line. Folders contained by a folder in the path are in this category. Examples are folders within<em> Windows</em> and <em>Windowssystem32 </em>such as the folders and &quot;Drivers&quot;. Folders that are in<em> Documents and Settings{Current User}</em> can also be opened in Run. An example is&nbsp; (written as one word). Being able to open this folder in Run is convenient for editing. It makes it easier to add functions to the &quot;Send To&quot; entry in the right-click context menu.&nbsp; Another example of a folder from the same location that can be entered is <em>Cookies</em>.<br />\r\n	<em>Note about Vista: Certain system folders like SendTo and Cookies are not directly accessible in Vista. See the <a href="http://commandwindows.com/shell.htm">Shell <br />\r\n	</a><br />\r\n	</em></p>\r\n', '1317302714cat1.png', '2011-09-28', 'A');
