INSERT INTO `tbl_pagecontent` (`id`, `category_id`, `sub_category_id`, `title`, `description`, `image`, `status`, `datemodified`) VALUES
(23, 1, 0, 'History & Background', '<p>\r\n	<img alt=\\"Island Map\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/tenerife-map-small.jpg\\" style=\\"float: right; width: 400px; height: 287px; margin-left: 20px; margin-bottom: 25px;\\" />Located just 100 kilometres off the western coast of northern Africa, natural beauty, unbeatable weather and age-old traditions set the tone in the unique island paradise of Tenerife. Known worldwide as the &quot;island of eternal spring,&quot; it was described by Homer and Herodotus as gardens of astounding beauty and, according to ancient myths, it could be the infamous Garden of Hesperydes where Greek god Atlas&#39; daughters tended to apple orchards.Tenerife&#39;s earliest days are a mysterious mix of myths and factual history until the unexplained appearance of the indigenous population known as the Guanches, who lived in kingdoms across the island until the 15th century Spanish conquest. Overtaken by Spanish forces,</p>\r\n<p>\r\n	Tenerife quickly became the crossroads of trade routes running between Europe, Africa and the Americas. Today Tenerife and its fellow Canary Islands comprise one of Spain&#39;s 17 autonomous communities. However, they celebrate a history and culture totally unlike that of their mainland counterparts.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\\"Mount Teide\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/mount-teide-small.jpg\\" style=\\"float: left; margin-bottom: 20px; margin-right: 20px;\\" />The vastly diverse island of Tenerife is a nature lover&#39;s utopia, a backpacker&#39;s paradise and a sun-seeker&#39;s dream. Nearly half of Tenerife&#39;s lands are protected by the government, allowing for the conservation of lush pine forests, colourful fields of wildflowers, plunging&nbsp; cliffs, natural volcanic craters and culminating with the often snow-capped Mount Teide- the highest peak in Spanish territory.<br />\r\n	<br />\r\n	Much of what makesTenerife so fascinating is the ever-changing flora and terrain. Contrasting the dry, flat and beach resort-laden south are the impossibly green banana plantations, rugged coastline and rocky coves of the north. Set into such fascinating natural surroundings, the north is also home to the island&#39;s most interesting towns, ranging from capital city hustle and bustle of Santa Cruz to the quaint small-town charm of Garachico. Outside of the towns you&#39;ll find endless opportunities for walking, hiking, biking,&nbsp; horseback riding, canyoning and rock-climbing- not to mention stunning views overlooking sweeping valleys and the crystalline blue ocean.</p>\r\n<p>\r\n	<br />\r\n	<img alt=\\"Beaches\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/tenerife-beach-loungers.jpg\\" style=\\"float: left; margin-right: 20px; margin-bottom: 20px;\\" />The warm, clear waters of the Atlantic Ocean break upon the shores of Tenerife&#39;s 269 kilometres of coastline. Whether you want to set your towel down on the stretches of&nbsp; beaches typical of the south or the secluded, black-sand coves of the north, there is something for everyone. If you want to kick things up a few notches, make a splash with a variety of water activities both above and below the surface. Explore the underwater beauty with a&nbsp; scuba-diving adventure, try out wind-surfing and ride the waves, buzz up and down the coast atop a jet-ski or set out on a whale-watching excursion to glimpse the colony of over 500 pilot whales that live just off of Tenerife&#39;s coast.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<br />\r\n	<img alt=\\"Auditorium\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/tenerife-auditorio.jpg\\" style=\\"float: left; margin-right: 20px; margin-bottom: 20px; margin-top: 10px;\\" />If you&#39;re more of a culture-vulture than a tree hugger, fret not! Tenerife&#39;s cultural scene is actually one of its most intriguing facets. Everything from the island&#39;s traditional&nbsp; architecture to its folk music, typical food (try the paella) artisan crafts,&nbsp; Canary Island sports and&nbsp; festivals boast the interwoven influences of the indigenous, Spanish, African and Latin American cultures that have played such major roles in the island&#39;s development.<br />\r\n	<br />\r\n	Complementing Tenerife&#39;s time-honoured traditional character is a modern, progressive cultural side. The island is brimming with an eclectic collection of&nbsp; museums where you can dive into worlds of science, contemporary art, archaeological finds and more. Theatres and concert venues of all varieties are dispersed throughout Tenerife&#39;s towns and cities, offering anything from modern rock concerts to opera and the Tenerife Symphony Orchestra.</p>\r\n', '1318081559cat1.jpg', 'A', '2011-11-10 06:51:45'),
(24, 1, 0, 'Weather', '<p>\r\n	Tenerife, known as the Island of Eternal Spring is located in the Atlantic, just off the north coast of Africa and enjoys a pleasant temperature in both the summer and winter; making it an excellent choice for a holiday at any time of the year. The coastal areas of Tenerife receive the best weather, with the south and the west enjoying the most sunshine, averaging up to 11 hours a day in the summer months.</p>\r\n<p>\r\n	The temperatures throughout the year vary very little on Tenerife ranging from 15c in the winter up to 24c in the summer. Even on its hottest days, the temperature on Tenerife rarely gets higher than 30c.&nbsp; The north-easterly trade winds ensure the temperatures on Tenerife stay constant, and add some welcome breezes, which tend to be stronger during the winter. Tenerife does not have a rainy season, but the island does see an occasional shower between November and March.</p>\r\n<p>\r\n	Divided by a mountain range, the weather on Tenerife does vary depending on location on the island. The south offers a dry climate, and tends to be hotter and sunnier than the north, making it a much more popular tourist destination. North Tenerife has a slightly wetter climate, and is home to a much greener landscape.&nbsp; The volcano El Teide in the centre of the island, boasting a peak of almost 4000m, can be seen from many beaches and frequently remains snow-capped during the winter months.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\\"Average Temperatures\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/average-temperatures.jpg\\" style=\\"width: 500px; height: 239px;\\" /></p>\r\n<p>\r\n	<img alt=\\"\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/average-rainfall.jpg\\" style=\\"width: 500px; height: 239px;\\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Check out the weather for your proposed holiday a few days before your departure.</strong></p>\r\n<p>\r\n	<a href=\\"http://www.aemet.es/en/eltiempo/prediccion/localidades/adeje-38010\\" target=\\"_blank\\">http://www.aemet.es/en/eltiempo/prediccion/localidades/adeje-38010</a></p>\r\n<p>\r\n	&nbsp;</p>\r\n', '1318022803cat1.jpg', 'A', '2011-11-07 06:16:28'),
