(26, 2, 0, 'Excursions', '<p>\r\n	Tenerife is blessed with an amazing variety of activities ensuring there is something to suit every holidaymaker regardless of age or taste. The most popular excursions and activities are shown in this section, many with a direct link to their own website. The Island is awash with excursion agencies so it is posible to book directly with the host operator on line or thru an agency located close to your holiday destination. You can obtain special deals from some attraction operators.&nbsp; For example Loro Park and Siam Park offer a discounted double ticket as do Aqualand and Jungle Park.&nbsp; Most attractions also offer free&nbsp; transportation from selected locations within the Resort areas.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<table border=\\"0\\" cellpadding=\\"10\\" cellspacing=\\"0\\" width=\\"100%\\">\r\n	<tbody>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/monkey-park.jpg\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Monkey Park</h3>\r\n				<p>\r\n					Monkey Park is located just off the TF-1 approximately 5 minutes from Los Cristianos. Although not as big as Loro Parque and Jungle Park, the Monkey Park is a favourite with visitors. You won&#39;t find fancy gift shops and restaurants here, and all the money made from entrance fees and the sale of monkey food is put back into the Park. If you love animals, particularly monkeys, then the Monkey Park is definitely worthy of a visit.</p>\r\n				<p>\r\n					<a href=\\"http://www.monkeypark.com\\" target=\\"_blank\\">www.monkeypark.com</a></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Dolphins and Whales\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/dolphin-excursions.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Dolphins and Whales</h3>\r\n				<p>\r\n					If you love dolphins and whales, then there are several boat excursions that leave from the Marina at Puerto Colon in Playa de las Americas&nbsp; and from the Port at Los Cristianos, including catamarans, pirate boats and glass bottom boats. Sail into the open waters and watch as the dolphins play alongside the boats, and keep your eyes open for the whales. <strong>A must for all dolphin and whales fans!</strong></p>\r\n				<p>\r\n					<a href=\\"http://www.freebirdone.com\\" target=\\"_blank\\">www.freebirdone.com</a></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Tenerife Pearl\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/tenerife-pearl.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Tenerife Pearl</h3>\r\n				<p>\r\n					If you love pearls or are celebrating a special occasion, why not visit Tenerife Pearl. Part of the World Pearl Group and situated in Arme&ntilde;ime, only 15 minutes drive from Los Cristianos, Tenerife Pearl has over 1,500m2 of Pearls and Pearl Jewellery, all beautifully displayed. Before you leave you can enjoy a meal in the caf&eacute; and have your picture taken at the Fountain of Love. A free coach service operates from Los Cristianos, Las Americas, Costa Adeje and Golf del Sur.</p>\r\n				<p>\r\n					<a href=\\"http://www.tenerifepearl.com/index.html\\" target=\\"_blank\\">www.tenerifepearl.com</a></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Pyramids\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/guimar-pyramids.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Guimar Pyramids</h3>\r\n				<p>\r\n					If history interests you then visit The Guimar Pyramids Ethnographic Park which is located inland from Tenerife&#39;s east coast. These six pyramids are similar to those in Sicily, Mexico, Mesopotamia, Polinesia and Peru and have been extensively researched since the early 1990&rsquo;s by Norwegian anthropologist, Thor Heyerdahl. The site has an information centre, caf&eacute;, shop and childrens playground. Buses are available from various pick up points in the South of Tenerife.&nbsp; Trips may be booked thru any excursion agency in Tenerife.</p>\r\n				<p>\r\n					<a href=\\"http://www.piramidesdeguimar.net/\\" target=\\"_blank\\">www.piramidesdeguimar.net</a></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Mount Teide\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/teide-national-park.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Mount Teide/Las Ca&ntilde;adas National Park</h3>\r\n				<p>\r\n					Mount Teide is the heart of Tenerife and one of the most visited attractions on the island. The journey takes you through the highest village in Spain, Vilaflor, Canarian pine forests and lunar landscapes. The summit of Mount Teide is only accessible by cable car from the visitor centre, where you will also find a caf&eacute; bar and gift shop.&nbsp; Full day or half day trips may be booked thru any excursion agency in Tenerife.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Siam Park\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/siam-park.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Siam Park&nbsp;</h3>\r\n				<p>\r\n					Siam Park provides a perfect day out for families, groups of friends and conference and incentive teams.Inspired by the old King of Thailand, Siam, the water park is the largest in Europe with more than a 52 million euro investment and 185,000 square metres of thrilling attractions along with 25 &lsquo;Thai&rsquo; style buildings. As well as all the exhilarating attractions there are numerous restaurants, bars, cocktail bars, chillout areas and even a Thai floating market!</p>\r\n				<p>\r\n					<a href=\\"http://www.siampark.net/en/\\" target=\\"_blank\\">www.siampark.net</a></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Loro Parque\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/loroparque.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Loro Parque</h3>\r\n				<p>\r\n					Loro Parque has always been known as one of the top visitor attractions on Tenerife, and with around 1.5 million visitors each year, it&#39;s easy to see why.Originally it was mainly a Parrot park, however the site now covers a massive 135,000 square metres and Loro Parque is home to some of the worlds most fascinating and exotic animals including Dolphins, Orca whales, Tigers, Penguins and sea-lions. It&#39;s a great day out for everyone.</p>\r\n				<p>\r\n					<a href=\\"http://www.loroparque.com/en/\\" target=\\"_blank\\">www.loroparque.com</a></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Jungle Park\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/jungle-park.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Jungle Park&nbsp;</h3>\r\n				<p>\r\n					Jungle Park (Las Aguilas Parque) is a spectacular zoological and botanical park in the mountains of Aguilas del Teide and yet less than 10 minutes away from Los Cristianos. Jungle Park provides approximately 75,000m2 of natural habitat in which over 500 animals live including, chimps, gibbons and big cats. Don&rsquo;t miss the bird shows where you can experience birds of prey and colourful exotic birds in free flight displaying their skills.</p>\r\n				<p>\r\n					<a href=\\"http://www.aguilasjunglepark.com\\" target=\\"_blank\\">www.aguilasjunglepark.com&nbsp;</a></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Medieval Castle\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/medieval-castle.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Medieval Castle</h3>\r\n				<p>\r\n					From the moment you enter the grounds, you find yourself in an authentic medieval world. In theTournament Hall, the&nbsp;show of medieval fights and games&nbsp;will take place in the presence&nbsp;of the Counts in their Royal &nbsp;Box seats. The Medieval adventure is an exciting and enjoyable attraction suitable for the whole family. It&#39;s an experience that shouldn&#39;t be missed! During the Tournament, you will be served the banquet just as it was done in medieval times;&nbsp;The soup is drunk and&nbsp;an entire chicken per person with its garnish &nbsp;is&nbsp;eaten by&nbsp;hand. The dinner is completed with dessert and beverages.&nbsp; Trips may be booked thru any excursion agency in Tenerife.</p>\r\n				<p>\r\n					<a href=\\"http://www.castillosanmiguel.com/castilloinformacion-en.html\\" target=\\"_blank\\">www.castillosanmiguel.com</a></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Yellow Submarine\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/yellow-submarine.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Yellow Submarine&nbsp;</h3>\r\n				<p>\r\n					Experience a dive on board a real submarine which will take you below the waters of San Miguel Marina.You will experience the true underwater world of Tenerife. We offer a free daily bus service when you book your dive from the main resort areas of Tenerife (Playa de las Americas/ Los Cristianos/ Los Gigantes etc.).</p>\r\n				<p>\r\n					<a href=\\"http://www.submarinesafaris.com/\\" target=\\"_blank\\">www.submarinesafaris.com</a></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Aqualand\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/aqualand.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Aqualand&nbsp;</h3>\r\n				<p>\r\n					Aqualand is situated at San Eugenio (Alto) in the Costa Adeje region, and is the only water park in the South of Tenerife with a Dolphinarium.Its internationally awarded Dolphin Shows make this a complete leisure option guaranteeing the best in entertainment and enjoyment.</p>\r\n				<p>\r\n					<a href=\\"http://www.aqualand.es/tenerife/index.php\\" target=\\"_blank\\">www.aqualand.es</a></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Quad Bikes\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/quad-park.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Quad Bikes&nbsp;</h3>\r\n				<p>\r\n					Experience the thrill and challenge of negotiating cross country trails and circuits, whilst enjoying some of the best views in the south of Tenerife. There are 200,000 sq metres of trail riding routes and circuits for you to explore! Located just ten minutes from Los Cristianos / Las Americas. Free local collection from resorts available. Open from 9.30 a.m. until dusk, 7 days per week.</p>\r\n				<p>\r\n					<a href=\\"http://www.quadparktenerife.com/\\" target=\\"_blank\\">www.quadparktenerife.com</a></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Karting\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/karting.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Karting&nbsp;</h3>\r\n				<p>\r\n					Welcome to the Karting Club Tenerife 1200 meters of fun and even 270cc. Of pure adrenaline! Come and experience the feelings of a professional behind the wheel! <strong>2 circuits:</strong> 1 senior and 1 junior to ensure maximum enjoyment for the whole family. The best facilities equipped with maximum security. Free bus service available.</p>\r\n				<p>\r\n					<a href=\\"http://www.kartingtenerife.com/\\" target=\\"_blank\\">www.kartingtenerife.com</a></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"La gomera\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/la-gomera.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Island Tours &amp; Gomera</h3>\r\n				<p>\r\n					There are a wide variety of island tours in Tenerife taking in all the major natural attractions and locations. You may also like to book a full-day all- inclusive tour of the neighbouring island La Gomera. Trips may be booked thru any excursion agency in Tenerife.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Bob Diving\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/bob-diving.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Bob Diving</h3>\r\n				<p>\r\n					First there was scuba diving... <strong>and then there was BOB Diving!</strong> All the underwater fun of traditional scuba diving, with much less effort. Despite looking like something secret agent 007 might use, you don&#39;t need to be James Bond to enjoy exploring Tenerife&#39;s underwater world. Our modern underwater scooters can be used by anyone. They are safe, easy and exciting. Safari BOB in Tenerife is the first BOB diving centre in Europe, operating since 1997, so while on holiday on the island, don&rsquo;t miss the opportunity to enjoy a fabulous underwater experience that will be the highlight of your trip. You&rsquo;ll find Safari BOB Diving in Puerto Colon, Playa de Las Americas, Pier no. 4.</p>\r\n				<p>\r\n					<a href=\\"http://www.bob-diving.com/\\" target=\\"_blank\\">www.bob-diving.com&nbsp;&nbsp;</a></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Camel Park\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/camel-park.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Camel Park</h3>\r\n				<p>\r\n					Just 10 minutes away from Los Cristianos and Playa de las Am&eacute;ricas, in rural surroundings, you can have a nice time riding a camel, seeing the farm animals (goats, donkeys,ducks,hens,chicks,grey parrots or dogs) and enjoy an apertive drink at the typical canarian house of the place. In the farm there is a souvenir shop where you can purchase different presents and camel figures. There is free transport to the farm from the south of the island.</p>\r\n				<p>\r\n					<a href=\\"http://www.camelpark.es/en/index.html\\" target=\\"_blank\\">www.camelpark.es</a></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	&nbsp;</p>\r\n', '', 'A', '2011-11-10 06:32:39'),
(27, 1, 0, 'Tenerife Beaches', '<p>\r\n	Tenerife&rsquo;s 269km. coastline hosts many beaches.&nbsp; Those in the main resort areas are usually of white sand and are well serviced with lifeguards, toilets, showers, and refreshment areas.&nbsp; However there are many beaches outside the main resort areas that are less busy and often naturally beautiful but lack the amenities of the main tourist areas.</p>\r\n<h2>\r\n	The Beaches of Los Cristianos and Playa de las Americas</h2>\r\n<table border=\\"0\\" cellpadding=\\"10\\" cellspacing=\\"0\\" width=\\"100%\\">\r\n	<tbody>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Los Cristianos\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/beach-los-cristianos.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Playa Los Cristianos</h3>\r\n				<p>\r\n					The town beach of Playa Los Cristianos overlooks the harbour so it&rsquo;s a great spot for watching the comings and goings of the inter island ferries, pleasure cruises and fishing boats. There&rsquo;s a volley ball court at the rear of the beach The further along the beach you travel, the less people there are and the less developed it is until you reach Playa Callao below Monta&ntilde;a de Guaza, a real get-away-from-it-all beach hardly a stone&rsquo;s throw from one of the south of Tenerife&rsquo;s main tourist resorts.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Las Vistas\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/beach-las-vistas.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Playa Las Vistas</h3>\r\n				<p>\r\n					Heading north around the corner from Los Cristianos harbour is arguably the south of Tenerife&rsquo;s best beach, Playa las Vistas, a long golden sand beach which links Playa de las Am&eacute;ricas with Los Cristianos. There are rows upon rows of sun loungers, but the size of the beach absorbs them. A huge fountain at the shoreline near the midway point of the beach is a distinctive feature on this beach.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Playa Del Camison\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/beach-del-camison.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Playa del Camis&oacute;n</h3>\r\n				<p>\r\n					Playa del Camis&oacute;n in front of the smart Sir Anthony hotel. It&rsquo;s a relaxing golden sand beach backed by palm trees which slopes gently into aquamarine waters. There are plenty of sun loungers and thatched umbrellas, but it can get quite busy. Playa del Camis&oacute;n in front of the smart Sir Anthony hotel. It&rsquo;s a relaxing golden sand beach backed by palm trees which slopes gently into aquamarine waters. There are plenty of sun loungers and thatched umbrellas, but it can get quite busy.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Playa Troya I\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/beach-troya.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Playa Troya I and II and Playa del Bobo</h3>\r\n				<p>\r\n					Much of the Playa de las Americas coastline hasn&rsquo;t been turned into man made beaches and the area which runs from Playa Troya II to Playa del Camis&oacute;n is quite rocky with a few rock pools and only a handful of sun beds. This undeveloped quality makes it perfect for people who prefer a more natural looking coastline and it&rsquo;s a popular spot for local surfers to ride the waves.</p>\r\n				<p>\r\n					Right in the centre of Playa de las Americas are Playa Troya I and II and Playa del Bobo. &nbsp;These three golden sand beaches are all equipped with sun-beds, thatched umbrellas and plenty of water sports are available.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"La Pinta\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/beach-la-pinta.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Playa La Pinta</h3>\r\n				<p>\r\n					Next along the coast is Playa la Pinta, a small pleasant golden sand beach bordered on one end by El Faro&rsquo;s mock lighthouse and the Puerto Col&oacute;n Marina on the other.&nbsp; This beach is also home to the Iceberg Park, a big inflatable iceberg &ndash; the only kind of iceberg that isn&rsquo;t going to melt in these temperatures.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Playa Faabe\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/beach-fanabe.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Playa Fa&ntilde;abe</h3>\r\n				<p>\r\n					It stretches from El Faro&rsquo;s mock lighthouse northwards towards the upmarket Del Duque area.&nbsp; It boasts a two-tier promenade complete with water sports and many land activities to entertain the children.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Playa del Duque\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/beach-del-duque.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Playa del Duque</h3>\r\n				<p>\r\n					Moving further north pass the imposing monastic building on the headland is Playa del Duque.&nbsp; This beach fronts the imposing Bahia del Duque hotel and many other 5 star hotels and has been developed with panache and imagination. If a beach could feel upmarket it&rsquo;s this one. Small enough to feel intimate, it&rsquo;s striped beach huts and palm frond umbrellas give it an air of St Tropez meets the Caribbean. The large volcanic rock, that borders the beach&rsquo;s southern side, blocks out the vista of Las Americas beyond.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	&nbsp;</p>\r\n<h2>\r\n	Other Notable Beaches in Tenerife</h2>\r\n<table border=\\"0\\" cellpadding=\\"10\\" cellspacing=\\"0\\" width=\\"100%\\">\r\n	<tbody>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"El Puertito\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/beach-puertito.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					El Puertito</h3>\r\n				<p>\r\n					Nestling between the resorts on the south and southwest coasts, the bay at El Puertito is probably what Tenerife&rsquo;s southern fishing hamlets looked like before the property developers moved in. Whitewashed buildings, a fish restaurant, aquamarine water, brightly coloured fishing boats and pale gold sand make you feel as though you&rsquo;re on an island that hasn&rsquo;t been discovered yet.</p>\r\n				<p>\r\n					<strong>But where is it?</strong> A small sign points the way from the TF47 just outside Arme&ntilde;ime on the road west to <a href=\\"http://www.realtenerifeislanddrives.com/Los%20Gigantes.html\\" target=\\"_blank\\">Los Gigantes</a>.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Playa de la Arena\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/beach-de-la-arena.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Playa de la Arena</h3>\r\n				<p>\r\n					&lsquo;Playa de la Arenas&rsquo; simply means &lsquo;sandy beach&rsquo;. The best one is found at the resort of the same name. A small, blue flag beach which is set in one of the nicest coves on Tenerife. With the most sunshine hours on the island, great views to the island of La Gomera and stunning sunsets, this is a sun worshipper&rsquo;s dream.</p>\r\n				<p>\r\n					<strong>But where is it?</strong> On Tenerife&rsquo;s sunny west coast, near <a href=\\"http://www.realtenerifeislanddrives.com/Los%20Gigantes.html\\" target=\\"_blank\\">Los Gigantes</a>, in the centre of the small resort of <a href=\\"http://www.realtenerifeislanddrives.com/Apartment.html\\" target=\\"_blank\\">Playa de la Arena</a>.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"El Mdano\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/beach-medano.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					El M&eacute;dano</h3>\r\n				<p>\r\n					A rarity for a beach on Tenerife, a golden(ish) beach which isn&rsquo;t man made. One of the longest beaches on Tenerife, book ended on one side by <a href=\\"http://www.realtenerifeislanddrives.com/El%20Medano.html\\" target=\\"_blank\\">El M&eacute;dano</a> and Monta&ntilde;a Roja on the other. A bleached wooden boardwalk runs almost the length of the beach passing surreal pumice rock formations and scores of rainbow bright windsurfers and kite-boarders. The presence of these &lsquo;surf dudes&rsquo; should warn you that the wind is a constant companion here. It might make pretty patterns in the sand, but it isn&rsquo;t always ideal for sunbathing. One of the most interesting beaches on Tenerife.</p>\r\n				<p>\r\n					<strong>But where is it?</strong> Right beside the town of the same name just past the airport on the way to Santa Cruz.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Playa de la Tejita\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/beach-la-tejita.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Playa de la Tejita</h3>\r\n				<p>\r\n					Another pale golden beach so long and wide you could land a jumbo jet on it, which isn&rsquo;t beyond the realms of possibility considering it&rsquo;s right next to the airport. It&rsquo;s another windy beach which makes it the ideal location for Granadilla&rsquo;s annual kite festival in September. The Monta&ntilde;a Roja end of the beach is popular with nudists.</p>\r\n				<p>\r\n					<strong>But where is it? </strong>Beyond <a href=\\"http://www.realtenerifeislanddrives.com/El%20Medano.html\\" target=\\"_blank\\">El M&eacute;dano</a>, on the other side of Monta&ntilde;a Roja.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\\"left\\" valign=\\"top\\" width=\\"200\\">\r\n				<img alt=\\"Playa de las Teresitas\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/beach-las-teresitas.jpg\\" style=\\"width: 180px; height: 150px;\\" /></td>\r\n			<td align=\\"left\\" valign=\\"top\\">\r\n				<h3>\r\n					Playa de las Teresitas</h3>\r\n				<p>\r\n					The jewel in the crown of Tenerife&rsquo;s beaches and without doubt the most spectacular. It&rsquo;s many people&rsquo;s idea of what a tropical beach should look like. A crescent shaped, lagoon-like bay with golden sand lapped by aquamarine waters. Add palm trees and a dramatic mountain backdrop and you&rsquo;ve got a perfect setting. There are changing rooms, toilets, bar restaurants and a large car park discreetly hidden behind the line of palms at the back of the beach. The man made reef makes the enclosed calm water ideal for families with young children. The only downside is that, being the east coast, it can be a tad breezy sometimes. Okay it&rsquo;s a man made beach, but it looks great.</p>\r\n				<p>\r\n					<strong>But where is it? </strong>Approx 8 kilometres beyond <a href=\\"http://www.realtenerifeislanddrives.com/Santa%20Cruz.html\\" target=\\"_blank\\">Santa Cruz</a>.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	&nbsp;</p>\r\n<h2>\r\n	YouTube Videos</h2>\r\n<p>\r\n	There are two great videos of Tenerife&rsquo;s beaches on YouTube.&nbsp; Each lasts about 4 minutes and gives a great insight into what&rsquo;s on offer.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<iframe frameborder=\\"0\\" height=\\"360\\" name=\\"Tenerife Beaches I\\" scrolling=\\"no\\" src=\\"http://www.youtube.com/embed/U4seYCMS3GM?rel=0%22%20frameborder=%220%22%20allowfullscreen\\" width=\\"640\\"></iframe></p>\r\n<p>\r\n	<br />\r\n	<iframe frameborder=\\"0\\" height=\\"360\\" name=\\"Tenerife Beaches II\\" scrolling=\\"no\\" src=\\"http://www.youtube.com/embed/kYpE_IjI8xY?rel=0%22%20frameborder=%220%22%20allowfullscreen\\" width=\\"640\\"></iframe></p>\r\n<p>\r\n	&nbsp;</p>\r\n', '', 'A', '2011-11-10 08:14:08'),
(28, 2, 0, 'Golf', '<p>\r\n	<img alt=\\"Golf in Tenerife\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/golf-map.jpg\\" style=\\"float: right; margin-left: 20px; margin-bottom: 20px; width: 300px; height: 225px;\\" />Tenerife is blessed with seven golf courses plus a short nine hole course at Los Palos. The high season for golf in Tenerife runs from October thru to April.&nbsp; Early booking of tee times is advised during this period with green fees ranging from 80&euro; up to 200&euro;. During the off season, May thru to September, it is possible to book a tee time at a moments notice and green fees drop to as little as 40&euro;. In the south of the Island there is also a short nine hole course, Los Palo, where green fees are less than 30&euro; for 18 holes.</p>\r\n<p>\r\n	Detailed information and booking of tee times in advance may be accessed by visiting the website of each particular course.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<table border=\\"0\\" cellpadding=\\"10\\" cellspacing=\\"0\\" width=\\"100%\\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\\"text-align: left; vertical-align: middle; width: 100px;\\">\r\n				<img alt=\\"Abama Golf\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/golf-abama.jpg\\" style=\\"width: 100px; height: 100px;\\" /></td>\r\n			<td style=\\"text-align: left; vertical-align: middle;\\">\r\n				<strong>Abama Golf</strong><br />\r\n				<a href=\\"http://www.abamahotelresort.com/golf_course_en/\\">http://www.abamahotelresort.com/golf_course_en/</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\\"text-align: left; vertical-align: middle; width: 100px;\\">\r\n				<img alt=\\"Amarilla Golf \\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/golf-amarilla.jpg\\" style=\\"width: 100px; height: 100px;\\" /></td>\r\n			<td style=\\"text-align: left; vertical-align: middle;\\">\r\n				<strong>Amarilla Golf&nbsp;</strong><br />\r\n				<a href=\\"http://www.canarycompanies.com/amarillagolf/campo18hoyos/informaciongeneraluk.html\\">http://www.canarycompanies.com/amarillagolf/indexuk.html</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\\"text-align: left; vertical-align: middle; width: 100px;\\">\r\n				<img alt=\\"Adeje Golf\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/golf-adeje.jpg\\" style=\\"width: 100px; height: 100px;\\" /></td>\r\n			<td style=\\"text-align: left; vertical-align: middle;\\">\r\n				<strong>Adeje Golf</strong><br />\r\n				<a href=\\"http://www.golfcostaadeje.com/en_bienvenidos.htm\\">http://www.golfcostaadeje.com/en_bienvenidos.htm</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\\"text-align: left; vertical-align: middle; width: 100px;\\">\r\n				<img alt=\\"Buena Vista Golf\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/golf-buenavista.jpg\\" style=\\"width: 100px; height: 100px;\\" /></td>\r\n			<td style=\\"text-align: left; vertical-align: middle;\\">\r\n				<strong>Buena Vista Golf</strong><br />\r\n				<a href=\\"http://www.buenavistagolf.es/index.asp?idioma=2\\">http://www.buenavistagolf.es/index.asp?idioma=2</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\\"text-align: left; vertical-align: middle; width: 100px;\\">\r\n				<img alt=\\"Golf del Sur\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/golf-del-sur.jpg\\" style=\\"width: 100px; height: 100px;\\" /></td>\r\n			<td style=\\"text-align: left; vertical-align: middle;\\">\r\n				<strong>Golf del Sur</strong><br />\r\n				<a href=\\"http://www.golfdelsur.es/\\">http://www.golfdelsur.es/</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\\"text-align: left; vertical-align: middle; width: 100px;\\">\r\n				<img alt=\\"Golf Las Americas\\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/golf-de-las-americas.jpg\\" style=\\"width: 100px; height: 100px;\\" /></td>\r\n			<td style=\\"text-align: left; vertical-align: middle;\\">\r\n				<strong>Golf Las Americas</strong><br />\r\n				<a href=\\"http://www.golf-tenerife.com/english/\\">http://www.golf-tenerife.com/english/</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\\"text-align: left; vertical-align: middle; width: 100px;\\">\r\n				<img alt=\\"Real Club de Golf  \\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/golf-real.jpg\\" style=\\"width: 100px; height: 100px;\\" /></td>\r\n			<td style=\\"text-align: left; vertical-align: middle;\\">\r\n				<strong>Real Club de Golf&nbsp;&nbsp;</strong><br />\r\n				<a href=\\"http://www.rcgt.es/extranet/\\">http://www.rcgt.es/extranet/</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\\"text-align: left; vertical-align: middle; width: 100px;\\">\r\n				<img alt=\\"Los Palos Golf    \\" src=\\"http://easyinfomatics.com/projects/tenerife/upload/guidetotenerife/golf-los-palos.jpg\\" style=\\"width: 100px; height: 100px;\\" /></td>\r\n			<td style=\\"text-align: left; vertical-align: middle;\\">\r\n				<strong>Los Palos Golf&nbsp;&nbsp;&nbsp;&nbsp;</strong>&nbsp;&nbsp;<br />\r\n				<a href=\\"http://www.golflospalos.com/\\">http://www.golflospalos.com/</a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	With the ever-increasing cost of transporting golf clubs to holiday destinations like Tenerife, why not consider hiring clubs from the golf course directly.&nbsp; Club rental charges vary but even the most expensive hire will cover two rounds of golf when compared to many airlines charges for golf club carriage to Tenerife.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n', '', 'A', '2011-11-10 08:45:37');
INSERT INTO `tbl_pagecontent` (`id`, `category_id`, `sub_category_id`, `title`, `description`, `image`, `status`, `datemodified`) VALUES
(29, 6, 0, 'Transport', '<p>\r\n	Getting around in Tenerife couldn&rsquo;t be simpler.&nbsp; Although there are no trains, there is a comprehensive bus service, a plentiful supply of taxis, and for the more independent minded there are dozens of car hire companies offering very competitive rates for all or part of your holiday.</p>\r\n<h2>\r\n	Buses</h2>\r\n<p>\r\n	The Tenerife Bus Company (TITSA) is both efficient and inexpensive and operates regular schedules to all parts of the Island. The buses of Tenerife are green in colour and a bus is referred to locally as a &ldquo; Guagua&rdquo; (pronounced <em>wah wah</em>). Route maps and timetables are available at bus stations and through all Tourist Information Centres on the Island. You can access the bus company&rsquo;s website at:</p>\r\n<p>\r\n	<a href=\\"http://www.titsa.com/index.php?idioma=2\\" target=\\"_blank\\">http://www.titsa.com/index.php?idioma=1</a></p>\r\n<p>\r\n	Popular routes include those that run from the Playa de las Americas bus station and Los Cristianos bus promenade to Santa Cruz, the capital in the north of the Island.&nbsp; Route 111 stops along the way and takes around 1hr. 15mins.&nbsp;&nbsp; Route 110 is a direct service and takes just an hour.&nbsp; You don&rsquo;t have to worry about where to get off as the bus stops in the Santa Cruz bus station which is next door to Corte Ingles, (Tenerife&rsquo;s answer to Selfridges) and just a 10min stroll to the centre of Santa Cruz.</p>\r\n<p>\r\n	If you want to go to Puerto de la Cruz, the main holiday resort in the north of the Island, you need route 343, which takes 1hr. 30mins. And again drops you at the bus station in Puerto de la Cruz. If you use the buses it is cheaper to buy a return ticket (ida y vuelta, pronounced eeda e welta, in Spanish).</p>\r\n<h2>\r\n	Taxis</h2>\r\n<p>\r\n	Official taxis are registered by the relevant town council and are white in colour often with a blue roof.&nbsp; Taxi ranks are everywhere and taxis may be flagged down anywhere.</p>\r\n<p>\r\n	There are published standard tariffs for daytime (06.00 to 22.00) minimum fare 3.05&euro; + 0.53&euro; per Km. Night time (22.00 to 06.00) and weekends are slightly more expensive at&nbsp; 3.35&euro; minimum fare + 0.60&euro; per Km.</p>\r\n<p>\r\n	All major taxi ranks display fares from that point to a variety of popular destination.&nbsp; Journeys within, say, Playa de las Americas would not normally exceed 5&euro;.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<h3>\r\n	A Guide To Taxi Fares From Tenerife South Airport</h3>\r\n<p>\r\n	The Taxi Rank At Tenerife South Airport is to the right of the Arrivals Hall and can sometimes be busy.&nbsp;</p>\r\n<p>\r\n	<strong>Resort Fare</strong></p>\r\n<ol>\r\n	<li>\r\n		El Medano - &euro;11.00</li>\r\n	<li>\r\n		Golf del Sur - &euro;15.00</li>\r\n	<li>\r\n		Playa de las Americas -&nbsp; &euro;25.00</li>\r\n	<li>\r\n		Los Cristianos - &euro;20.00</li>\r\n	<li>\r\n		Los Gigantes - &euro;45.00</li>\r\n	<li>\r\n		Santa Cruz - &euro;62.00</li>\r\n	<li>\r\n		Tenerife North Airport - &euro;66.00</li>\r\n	<li>\r\n		Puerto de la Cruz - &euro;90.00</li>\r\n</ol>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Why not pre book your taxi return transfer to the Resort before leaving home. Simply search &ldquo;tenerife taxi transfers&rdquo; on the web, select your chosen company (they&rsquo;re all pretty similar in cost and generally cheaper than the conventional taxi) and the advantage is that the company will be waiting for you in the Arrivals Hall and whisk you off to your Resort without any time-wasting queuing.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<h2>\r\n	Care Hire</h2>\r\n<p>\r\n	There are dozens of car hire companies operating in Tenerife so rates are very competitive.&nbsp; Most will drop off and pick up cars at the airport and will have a representative waiting for you on the street side of the arrivals hall.&nbsp; Beware, some companies might take you to their depot off airport to complete rental formalities; not a problem in itself but it all adds to the delay in getting to your chosen holiday home.</p>\r\n<p>\r\n	Seven Car Hire Companies operate from the airport arrivals hall so if you decide to use one of these companies it&rsquo;s possible to complete the rental formalities whilst waiting for your luggage. The companies are:</p>\r\n<ul>\r\n	<li>\r\n		<a href=\\"http://www.tenerife-hire-a-car.com/car_hire/paso1.php\\" target=\\"_blank\\">http://www.tenerife-hire-a-car.com/car_hire/paso1.php</a></li>\r\n	<li>\r\n		<a href=\\"http://www.avis.co.uk/Default.aspx\\" target=\\"_blank\\">http://www.avis.co.uk/Default.aspx</a></li>\r\n	<li>\r\n		<a href=\\"http://www.avis.co.uk/Default.aspx\\" target=\\"_blank\\">http://www.avis.co.uk/Default.aspx</a></li>\r\n	<li>\r\n		<a href=\\"http://www.autoreisen.es/ingles/tenerife_car_hire.php\\" target=\\"_blank\\">http://www.autoreisen.es/ingles/tenerife_car_hire.php</a></li>\r\n	<li>\r\n		<a href=\\"http://www.cicar.com/EN/Canary-Islands\\" target=\\"_blank\\">http://www.cicar.com/EN/Canary-Islands</a></li>\r\n	<li>\r\n		<a href=\\"http://www.europcar.co.uk/car-hire-SPAIN.html\\" target=\\"_blank\\">http://www.europcar.co.uk/car-hire-SPAIN.html</a></li>\r\n	<li>\r\n		<a href=\\"http://www.goldcar.es/en/#lugar1\\" target=\\"_blank\\">http://www.goldcar.es/en/#lugar1</a></li>\r\n</ul>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Don&rsquo;t forget the average return taxi fare to the main resort area is 50&euro; which can represent a third of the weekly rental cost of an economy hire car. So if you&rsquo;re happy with driving on the right don&rsquo;t forget to pack your licence and enjoy the freedom that your own holiday transport will afford!</p>\r\n', '', 'A', '2011-11-10 09:51:33'),
(30, 6, 0, 'Flights', '<p>\r\n	Flights to Tenerife are presently available from 21 mainland UK airports and 4 airports in Ireland (inc. Belfast Int. in Northern Ireland).</p>\r\n<h3>\r\n	Airports serving Tenerife (Reina Sofia Airport) with direct flights.<br />\r\n	&nbsp;</h3>\r\n<table border=\\"0\\" cellpadding=\\"10\\" cellspacing=\\"0\\" style=\\"width: 100%;\\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<strong>Airport (Code)</strong></td>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<ul>\r\n					<li>\r\n						Aberdeen (ABZ)</li>\r\n					<li>\r\n						Belfast International (BFS)</li>\r\n					<li>\r\n						Birmingham (BHX)</li>\r\n					<li>\r\n						Blackpool (BLK)</li>\r\n					<li>\r\n						Bournemouth (BOH)</li>\r\n					<li>\r\n						Bristol (BRS)</li>\r\n					<li>\r\n						Cardiff (CWL)</li>\r\n					<li>\r\n						Cork (ORK)</li>\r\n					<li>\r\n						Doncaster Sheffield (DSA)</li>\r\n					<li>\r\n						Dublin (DUB)</li>\r\n					<li>\r\n						Durham Tees Valley (MME)</li>\r\n					<li>\r\n						East Midlands (EMA)</li>\r\n					<li>\r\n						Edinburgh (EDI)</li>\r\n				</ul>\r\n			</td>\r\n			<td>\r\n				<ul>\r\n					<li>\r\n						Exeter (EXT)</li>\r\n					<li>\r\n						Glasgow International (GLA)</li>\r\n					<li>\r\n						Glasgow Prestwick (PIK)</li>\r\n					<li>\r\n						Leeds Bradford (LBA)</li>\r\n					<li>\r\n						Liverpool (LPL)</li>\r\n					<li>\r\n						London Gatwick (LGW)</li>\r\n					<li>\r\n						London Luton (LTN)</li>\r\n					<li>\r\n						London Stansted (STN)</li>\r\n					<li>\r\n						Manchester (MAN)</li>\r\n					<li>\r\n						Newcastle (NCL)</li>\r\n					<li>\r\n						Norwich&nbsp; (NWI)</li>\r\n					<li>\r\n						Shannon (SNN)</li>\r\n				</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<h3>\r\n	Eight airlines currently offer flights to Tenerife from the UK &amp; Ireland:</h3>\r\n<ol>\r\n	<li>\r\n		<a href=\\"http://www.aerlingus.com/home/index.jsp\\" target=\\"_blank\\"><strong>Air Europa</strong></a></li>\r\n	<li>\r\n		<a href=\\"http://www.easyjet.com/asp/en/book/index.asp?lang=en\\" target=\\"_blank\\"><strong>Aer Lingus</strong></a></li>\r\n	<li>\r\n		<a href=\\"http://www.jet2.com/\\" target=\\"_blank\\"><strong>easyJet</strong></a></li>\r\n	<li>\r\n		<a href=\\"http://www.monarch.co.uk/\\" target=\\"_blank\\"><strong>Jet2</strong></a></li>\r\n	<li>\r\n		<a href=\\"http://www.ryanair.com/en\\" target=\\"_blank\\"><strong>Ryanair</strong></a></li>\r\n	<li>\r\n		<a href=\\"http://book.flythomascook.com\\" target=\\"_blank\\"><strong>Thomas Cook</strong></a></li>\r\n	<li>\r\n		<a href=\\"http://flights.thomson.co.uk/en/index.html\\" target=\\"_blank\\"><strong>Thompson</strong></a></li>\r\n	<li>\r\n		<a href=\\"http://www.skyscanner.net/\\" target=\\"_blank\\"><strong>Skyscanner</strong></a> - Recommended</li>\r\n</ol>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	From this information you will gather there is a wide choice of options.<br />\r\n	So where&rsquo;s the best place to start?&nbsp;&nbsp; A good general flight search engine!</p>\r\n<p>\r\n	When using this site it&rsquo;s a good idea to search for flights from your chosen airport for the complete month rather than particular dates.&nbsp; You may find by adjusting your departure and return dates you can save money on the flight element of your holiday.</p>\r\n<p>\r\n	Why not consider travelling on days other than the traditional Tenerife flight days.&nbsp; Sometimes a 6 day or 13 day holiday can save considerably on flight costs.</p>\r\n<p>\r\n	Why not consider using different airlines for the outbound and inbound flights.&nbsp; This could result in more socially acceptable arrival times both in Tenerife and in the UK and should not increase overall flight &nbsp;&nbsp;costs.</p>\r\n<p>\r\n	Don&rsquo;t ignore the cheap package-holiday offers that line up with your proposed holiday dates.&nbsp; These offers may afford a better deal than a flight only option and you simply dump the package-holiday accommodation on arrival in Tenerife.<br />\r\n	&nbsp;</p>\r\n', '', 'A', '2011-11-10 10:03:59');
