(1, 'Advertise with us for as little as *1 per week', '<div class="ppts_subs" style="margin: 0px; padding: 10px 0px 0px 10px; outline-style: none; font: 13px Arial,Helvetica,sans-serif; color: rgb(0, 0, 0); float: left; width: 671px; text-align: justify;">\r\n	No minimum Contract period, Stop and Start as you wish your at the end of the period you have selected. UNLIKE our Competitors YOU have the Options to pay monthly, half yearly or annually.20% discount for Annual payment, 10% for Half Yearly payment.</div>\r\n<div style="margin: 0px; padding: 0px; outline-style: none;">\r\n	<div class="ppts_subscnt" style="margin: 20px 0px 0px 25px; padding: 0px; outline-style: none; float: left; width: 380px;">\r\n		<ul style="margin: 0px; padding: 0px; outline-style: none; list-style-type: none; float: left; width: 380px;">\r\n			<li style="margin: 0px; padding: 3px 0px 0px 10px; outline-style: none; list-style-type: none; float: left; font: 13px Arial,Helvetica,sans-serif; color: rgb(0, 0, 0); width: 378px;">\r\n				<a href="#" style="margin: 0px; padding: 0px; outline-style: none; color: rgb(0, 0, 0); text-decoration: none; cursor: pointer;">&bull; Take advantage of our 30 day FREE TRIAL</a></li>\r\n			<li style="margin: 0px; padding: 3px 0px 0px 10px; outline-style: none; list-style-type: none; float: left; font: 13px Arial,Helvetica,sans-serif; color: rgb(0, 0, 0); width: 378px;">\r\n				<a href="#" style="margin: 0px; padding: 0px; outline-style: none; color: rgb(0, 0, 0); text-decoration: none; cursor: pointer;">&bull; Option to pay Monthly</a></li>\r\n			<li style="margin: 0px; padding: 3px 0px 0px 10px; outline-style: none; list-style-type: none; float: left; font: 13px Arial,Helvetica,sans-serif; color: rgb(0, 0, 0); width: 378px;">\r\n				<a href="#" style="margin: 0px; padding: 0px; outline-style: none; color: rgb(0, 0, 0); text-decoration: none; cursor: pointer;">&bull; Discounts available for Half Yearly and Yearly</a></li>\r\n            <li style="margin: 0px; 